import React from "react";

const Club = (props) => {
  return (
    <div>
      <i alt="img-icon-club" className={props.icon}>
        {" "}
      </i>
      <h2> {props.name}</h2>
      <ul>
        Members: <li>{props.subjects}</li>
      </ul>
    </div>
  );
};

export default Club;
